import { UserProvider } from './ContextMain';

class CompnentOne extends Component {
  render() {
    return (
        <UserProvider>
         {
            (Salah) => {
                return (
                    <div><h1>WElcome {Salah}</h1></div>
                    
                )
            }
         }
        </UserProvider>
    )
  }
}

export default CompnentOne;


